import React from "react";
import Navbar from "./Navbar";
import ViewArea from "./ViewArea";

function ProblemView() {
  const id = 1;
  const uid = 1;
  return (
    <div id = "">
      <Navbar />
      <ViewArea id={id} uid={uid} />
    </div>
  );
}

export default ProblemView;
